all_search: 'Stanford University News Service Stanford News Service records, circa
  1891-2013. 308.75 linear feet Special Collections and University Archives materials
  are stored offsite and must be paged 48 hours in advance. For more information on
  paging collections, see the department''s website: http://library.stanford.edu/spc.
  The materials are open for research use, and must be requested at least 48 hours
  in advance of intended use. Audio-visual materials are not available in original
  format, and must be reformatted to a digital use copy. Records include subject files
  compiled by the News Service in the course of its work, news releases prepared by
  the News Service, proof sheets of photographs produced by the News Service photographers,
  taped interviews, office files of the Director of News and Publications Service
  and of the directors of the individual units, news clippings, and miscellaneous
  photographic and printed material. Also included are diploma date blocks (for diploma
  printing). All requests to reproduce, publish, quote from, or otherwise use collection
  materials must be submitted in writing to the Head of Special Collections and University
  Archives, Stanford University Libraries, Stanford, California 94304-6064. Consent
  is given on behalf of Special Collections as the owner of the physical items and
  is not intended to include or imply permission from the copyright owner. Such permission
  must be obtained from the copyright owner, heir(s) or assigns. See: http://library.stanford.edu/depts/spc/pubserv/permissions.html.   Restrictions
  also apply to digital representations of the original materials. Use of digital
  files is restricted to research and educational purposes. The Stanford News Service
  is part of the Office of University Communications. The News Service reports and
  disseminates much of the University''s news, via the STANFORD REPORT daily news
  email.  Previously the department was known as the Stanford News and Publications
  Service, and was a part of the Public Affairs Office. The News Service produced
  the weekly CAMPUS REPORT (later STANFORD REPORT) and the monthly STANFORD OBSERVER.   The
  News Service was originally created to take over some functions previously performed
  by the General Secretary''s Office. In 1946 a news and information office was created
  when Frederic O. Glover was appointed Director of Information; when Glover became
  secretary to the president, Peter C. Allen was named director of Information and
  Publications. In 1962, The office was expanded and became part of the newly created
  University Relations Office with Peter Allen as director of Publications and Robert
  W. Beyers as director of the News Service. News and Publications was again united
  when Allen was named Associate director of University Relations (and later University
  editor), and Beyers became director of News and Publications. Administrative transfer,
  News Service. Allen, Peter C. Beyers, Robert W. Glover, Frederic O. Peterson, Walter.
  Bartholomew, Karen News agencies Stanford University. Photojournalism Stanford University.
